import React from "react";
import {
  ICNDiscord,
  ICNFacebook,
  ICNGithub,
  ICNInstagram,
  ICNLogo
} from "../../../assets";

const Icon = ({ img }) => {
  return (
    <div>
      <img src={img} alt="icon" />
    </div>
  );
};

const Footer = () => {
  return (
    <div>
      <div>
        <div>
          <img src={<ICNLogo />} />
        </div>
        <div>
          <Icon img={<ICNDiscord />} />
          <Icon img={<ICNFacebook />} />
          <Icon img={<ICNDiscord />} />
          <Icon img={<ICNDiscord />} />
          <Icon img={<ICNDiscord />} />
        </div>
      </div>
      <div>
        <p>Copyright</p>
      </div>
    </div>
  );
};

export default Footer;
